export function Ticker ({
  ticker,
  exchange,
  price,
  change,
  change_percent
}) 
{
  return (
    <div className="row">
      <p className="col">Name: {ticker}</p>
      <p className="col text-end">Stock: {exchange}</p>
      <p className="col text-end">Price: {price}$</p>
      <p className="col text-end">Change: {change}$</p>
      <p className="col text-end">Change in percents: {change_percent}</p>
    </div>
  )
}
